/**
 * Khai báo const để không bị ghi đè.
 * Có thể dùng Line Awesome hoặc dùng SVG.
 * Nên dùng Line Awesome cho đồng bộ.
 * Nếu dùng SVG thì lại không phải phụ thuộc thư viện nữa.
 * SVG lấy ở địa chỉ:
 *     https://github.com/icons8/line-awesome/tree/master/svg
 */
const noti = (() => {

    // Tùy chọn mặc định
    const DEFAULT_OPTIONS = {
        // CSS class, quy định màu sắc
        cssClass: '',
        // CSS class của icon hiển thị trước nội dung alert
        icon: '',
        // Xâu SVG của icon
        iconSvg: '',
        // thời gian hiển thị thông báo, tính bằng ms, mặc định 5 giây
        duration: 5000,
        // tự động đóng thông báo
        autoClose: true
    };

    /**
     * Lấy vùng chứa các thông báo.
     */
    function getNotiContainer() {
        // Vùng chứa là một vùng div có ID là noti và class là .noti
        let notiContainer = document.querySelector('#noti');

        // Nếu chưa có thì thêm vào trong trang
        if (notiContainer == null) {
            notiContainer = document.createElement('div');
            notiContainer.className = 'noti';
            notiContainer.id = 'noti';
            document.body.appendChild(notiContainer);
        }

        return notiContainer;
    }

    /**
     * Hàm chung.
     * @param {String} text Nội dung thông báo
     * @param {Object} options Tùy chọn
     */
    function notify(text, options = {}) {
        // Kết hợp tùy chọn mặc định và tùy chọn của người dùng
        options = Object.assign({}, DEFAULT_OPTIONS, options);

        const alertTag = createAlertTag(text, options);

        // Thêm thông báo vào trang
        const notiContainer = getNotiContainer();
        notiContainer.appendChild(alertTag);

        // Tự động đóng thông báo sau khoảng thời gian cho trước
        if (options.autoClose) {
            setTimeout(() => {
                closeNotification(alertTag);
            }, options.duration);
        }
    }

    /**
     * Tạo đối tượng DOMNode thông báo.
     * @param {String} text Nội dung thông báo
     * @param {Object} options Tùy chọn
     */
    function createAlertTag(text, options) {
        // Nội dung thông báo
        const alertTag = document.createElement('div');
        alertTag.className = 'alert ' + options.cssClass;

        // Icon
        if (options.icon) {
            const iconMarkup = document.createElement('span');
            iconMarkup.className = options.icon + ' mr-2';
            alertTag.appendChild(iconMarkup);
        }

        if (options.iconSvg) {
            const iconMarkup = document.createElement('span');
            iconMarkup.className = 'svg-icon';
            iconMarkup.innerHTML = options.iconSvg;
            // alertTag.appendChild(iconMarkup);
        }

        // Text
        const textSpan = document.createElement('span');
        textSpan.innerHTML = text;
        alertTag.appendChild(textSpan);

        // Khi click vào thì đóng thông báo
        alertTag.addEventListener('click', () => {
            closeNotification(alertTag);
        });

        return alertTag;
    }

    /**
     * Xóa thông báo cũ.
     * @param {DOMNode} element Đối tượng thông báo
     */
    function closeNotification(element) {
        element.classList.add('fade-out');
        setTimeout(() => {
            // Chú ý, có trường hợp người dùng đã chủ động xóa (bằng cách click vào thông báo)
            // nên khi tự động xóa bằng timeout sẽ bị lỗi
            const parentNode = element.parentNode;
            if (parentNode) {
                parentNode.removeChild(element);
            }
        }, 500);
    }

    /**
     * Hàm chung (nữa).
     * @param {String} text Nội dung thông báo
     * @param {Object} defaultOptionsOfType Tùy chọn mặc định có từng loại (error, success, info, warning)
     * @param {Object} options Tùy chọn của người dùng
     */
    function notifyWithDefault(text, defaultOptionsOfType, options = {}) {
        options = Object.assign({}, defaultOptionsOfType, options);
        notify(text, options);
    }

    /**
     * Thông báo lỗi.
     */
    function displayError(text, options) {
        notifyWithDefault(text, {
            cssClass: 'alert-error bg-danger',
            icon: 'la la-exclamation-circle',
            iconSvg: '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32"><path fill="#FFF" d="M 16 4 C 9.382813 4 4 9.382813 4 16 C 4 22.617188 9.382813 28 16 28 C 22.617188 28 28 22.617188 28 16 C 28 9.382813 22.617188 4 16 4 Z M 16 6 C 21.535156 6 26 10.464844 26 16 C 26 21.535156 21.535156 26 16 26 C 10.464844 26 6 21.535156 6 16 C 6 10.464844 10.464844 6 16 6 Z M 15 10 L 15 18 L 17 18 L 17 10 Z M 15 20 L 15 22 L 17 22 L 17 20 Z"/></svg>'
        }, options); // , autoClose: false
    }

    /**
     * Thông báo thành công.
     */
    function displaySuccess(text, options) {
        notifyWithDefault(text, {
            cssClass: 'alert-success bg-success',
            icon: 'la la-check',
            iconSvg: '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32"><path fill="#FFF" d="M 28.28125 6.28125 L 11 23.5625 L 3.71875 16.28125 L 2.28125 17.71875 L 10.28125 25.71875 L 11 26.40625 L 11.71875 25.71875 L 29.71875 7.71875 Z"/></svg>'
        }, options);
    }

    /**
     * Thông báo.
     */
    function displayInfo(text, options) {
        notifyWithDefault(text, {
            cssClass: 'alert-info bg-info',
            icon: 'la la-info-circle',
            iconSvg: '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32"><path fill="#FFF" d="M 16 3 C 8.832031 3 3 8.832031 3 16 C 3 23.167969 8.832031 29 16 29 C 23.167969 29 29 23.167969 29 16 C 29 8.832031 23.167969 3 16 3 Z M 16 5 C 22.085938 5 27 9.914063 27 16 C 27 22.085938 22.085938 27 16 27 C 9.914063 27 5 22.085938 5 16 C 5 9.914063 9.914063 5 16 5 Z M 15 10 L 15 12 L 17 12 L 17 10 Z M 15 14 L 15 22 L 17 22 L 17 14 Z"/></svg>'
        }, options);
    }

    /**
     * Cảnh báo.
     */
    function displayWarning(text, options) {
        notifyWithDefault(text, {
            cssClass: 'alert-warning bg-warning',
            icon: 'la la-exclamation-triangle',
            iconSvg: '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32"><path fill="#111" d="M 16 3.21875 L 15.125 4.71875 L 3.125 25.5 L 2.28125 27 L 29.71875 27 L 28.875 25.5 L 16.875 4.71875 Z M 16 7.21875 L 26.25 25 L 5.75 25 Z M 15 14 L 15 20 L 17 20 L 17 14 Z M 15 21 L 15 23 L 17 23 L 17 21 Z"/></svg>'
        }, options);
    }

    /**
     * Xác nhận.
     * @param {String} text Nội dung xác nhận
     * @param {Function} callback Hàm gọi khi người dùng đồng ý
     */
    function displayConfirm(text, callback) {
        // Vùng chứa confirm
        const confirmContainer = document.createElement('div');
        confirmContainer.className = 'noti-confirm';
        confirmContainer.innerHTML = `            
                <div class="confirm-dialog">
                    <div class="confirm-message text-break text-left font-size-1.25 p-4">
                        ${text}
                    </div>

                    <div class="confirm-buttons text-right p-3">
                        <button class="button accept btn btn-primary">
                            Đồng ý
                        </button>
                        
                        <button class="button reject btn btn-outline-secondary">
                            Đóng
                        </button>
                    </div>
                </div>`;

        // Ẩn confirm
        const hideConfirm = () => {
            confirmContainer.parentNode.removeChild(confirmContainer);
        };

        confirmContainer.querySelector('.accept').addEventListener('click', () => {
            hideConfirm();
            callback();
        });
        confirmContainer.querySelector('.reject').addEventListener('click', () => {
            hideConfirm();
        });

        // Click ở bên trong thì dừng lại
        confirmContainer.querySelector('.confirm-dialog').addEventListener('click', (evt) => {
            evt.stopPropagation();
        });

        // Click ra ngoài thì đóng
        confirmContainer.addEventListener('click', () => {
            hideConfirm();
        });

        // Hiển thị
        document.body.appendChild(confirmContainer);

        // Focus vào nút OK, có thể nhấn Enter
        // okButton.focus();
    }

    return {
        error: displayError,
        success: displaySuccess,
        info: displayInfo,
        warning: displayWarning,
        confirm: displayConfirm
    };
})();


// Quy hoạch vào một namespace
const CV = {};

/**
 * Hàm tiện ích dịch message lỗi.
 * Nếu muốn đa ngôn ngữ thì hãy ghi đè hàm này.
 * @param {String} msg Message lỗi
 */
CV.tranlateErrorMessage = (msg) => {
    return msg;
};
/**
 * Chuẩn hóa số điện thoại: loại bỏ các ký tự không phải là số.
 * @param {String} value Xâu giá trị
 */
CV.normalizePhoneNumber = (value) => {
    return value.replace(/[^0-9]/g, '');
};

/**
 * Chuẩn hóa ngày tháng về dạng dd/mm/yyyy.
 * Test-case:
 * ['1/1/2018'].forEach(s => console.log(normalizeDate(s)))
 * @param {String} value Xâu đầu vào, là một ngày đã hợp lệ
 */
CV.normalizeDate = (value) => {
    // Split ngày tháng năm (theo các ký tự gạch ngang, slash, chấm)
    const arr = value.split(/\-|\/|\./);
    const day = parseInt(arr[0], 10);
    const month = parseInt(arr[1], 10);
    const year = parseInt(arr[2]);

    return (day < 10 ? ('0' + day) : day) +
        '/' +
        (month < 10 ? ('0' + month) : month) +
        '/' +
        year;
};
/**
 * Kiểm tra một giá trị có phải là bỏ trống hay không.
 * Chú ý: nhập 0 không coi là rỗng, sẽ trả về false.
 * @param value Giá trị
 * @returns true nếu val là rỗng
 */
CV.validateEmpty = (value) => {
    return (value === null || value === '');
};

/**
 * Kiểm tra định dạng ngày.
 * Các định dạng ngày hợp lệ là:
 * dd/mm/yyyy or dd-mm-yyyy or dd.mm.yyyy
 * Test-case:
 * Đúng: ['11/05/1987', '17/05/1987', '1/1/2000', '29/02/2000', '31/12/2018'].forEach(s => console.log(validateDate(s)))
 * Sai: ['29/02/1987', '29/02/1900', '31/04/2000'].forEach(s => console.log(validateDate(s)))
 */
CV.validateDate = (value) => {
    const regExp = /^\d{1,2}(\-|\/|\.)\d{1,2}\1\d{4}$/;

    // Check to see if in correct format
    if (!regExp.test(value)) {
        // Doesn't match pattern, bad date
        return false;
    } else {
        // Split ngày tháng năm
        const arr = value.split(/\-|\/|\./);
        const day = parseInt(arr[0], 10);
        const month = parseInt(arr[1], 10);
        const year = parseInt(arr[2]);

        //console.log(intDay, intMonth, intYear);

        // Create a lookup for months not equal to Feb.
        const arrayLookup = {
            '1': 31,
            '3': 31,
            '4': 30,
            '5': 31,
            '6': 30,
            '7': 31,
            '8': 31,
            '9': 30,
            '10': 31,
            '11': 30,
            '12': 31
        };

        // Check if month value and day value agree
        if (arrayLookup[month] != null) {
            if (day <= arrayLookup[month] && day > 0) {
                // Found in lookup table, good date
                return true;
            }
        }

        // Check for February
        if (month == 2) {
            if (day > 0 && day < 29) {
                return true;
            } else if (day == 29) {
                if ((year % 4 == 0 && year % 100 != 0) || (year % 400 == 0)) {
                    // Year div by 4 and ((not div by 100) or div by 400) -> ok
                    return true;
                }
            }
        }
    }

    // Any other values, bad date
    return false;
};

/**
 * Validate địa chỉ email.
 * @param value Địa chỉ email
 * @return true nếu địa chỉ email hợp lệ
 */
CV.validateEmail = (value) => {
    const regex = /[A-Z0-9._%+-]+@[A-Z0-9-]+.+.[A-Z]{2,4}/i;
    // const regex = /(^[a-z]([a-z0-9_\.]*)@([a-z_\.]*)([.][a-z]{3})$)|(^[a-z]([a-z0-9_\.]*)@([a-z_\.]*)(\.[a-z]{3})(\.[a-z]{2})*$)/i;
    return regex.test(value);
};

/**
 * Validate số điện thoại.
 * @param value 
 */
CV.validatePhoneFormat = (value) => {
    const regex = /^\d*$/;
    return regex.test(value);
};

/**
 * Validate độ dài số điện thoại.
 * @param value 
 */
CV.validatePhoneLength = (value) =>  {
    // Tu 9 den 12 ky tu
    const minLength = 9;
    const maxLength = 12;
    return (minLength <= value.length && value.length <= maxLength);
};

/**
 * Validate là số nguyên.
 * @param value 
 */
CV.validateInteger = (value) => {
    const regex = /(^-?\d\d*$)/;
    return regex.test(value);
};

/**
 * Validate là số nói chung.
 * @param value Xâu giá trị
 */
CV.validateNumber = (value) => {
    // Regular Expression: /(^-?\d\d*\.\d*$)|(^-?\d\d*$)|(^-?\.\d\d*$)/;
    return !isNaN(value);
};

/**
 * Validate URL hợp lệ.
 * @param value Giá trị URL
 * @returns true nếu giá trị là một URL hợp lệ
 */
CV.validateUrl = (value) => {
    const regex = /^(https?:\/\/)?([\da-z\.-]+)\.([a-z\.]{2,6})([\/\w \.-]*)*\/?$/i;
    return regex.test(value);
};

/**
 * Validate chứng minh thư chỉ có 9 hoặc 12 ký tự.
 * @param value Giá trị
 */
CV.validateIdNumberLength = (value) => {
    const length1 = 9;
    const length2 = 12;
    return (value.length == length1 || value.length == length2);
};

/**
 * Validate chứng minh thư chỉ chứa chữ hoặc số.
 * @param value Giá trị
 */
CV.validateIdNumberOnlyLetter = (value) => {
    const regex = /^[a-zA-Z\d]+$/;
    return regex.test(value);
};

/**
 * Validate chứng minh thư phải có số (không được chỉ gồm chữ thôi).
 * @param value Giá trị
 */
CV.validateIdNumberHasNumber = (value) => {
    const regex = /\d+/;
    return regex.test(value);
};

/**
 * Validate mật khẩu ít nhất 8 ký tự.
 * @param value 
 */
CV.validatePasswordLength = (value) => {
    return value.length >= 8;
};

/**
 * Validate mật khẩu không được chứa dấu cách.
 * @param value 
 */
CV.validatePasswordSpace = (value) => {
    const regex = /\s/g;
    return value.match(regex);
};

/**
 * Validate mật khẩu không được chứa ký tự tiếng Việt.
 * @param value 
 */
CV.validatePasswordVietnamese = (value) => {
    const regex = /[àáạảãâầấậẩẫăằắặẳẵèéẹẻẽêềếệểễìíịỉĩòóọỏõôồốộổỗơờớợởỡùúụủũưừứựửữỳýỵỷỹđ]/gi;
    return value.match(regex);
};

/**
 * Validate mật khẩu phải bao gồm chữ hoa, chữ thường, số, ký tự đặc biệt.
 * @param value 
 */
CV.validatePasswordStrong = (value) => {
    const regex = /(?=.*[A-Z])(?=.*[a-z])(?=.*[0-9])(?=.*[!@#$%&*])/g;
    return value.match(regex);
};

/**
 * Kiểm tra tên miền.
 */
CV.validateDomainName = (value) => {
    const regex = /^(?:[a-z0-9](?:[a-z0-9-]{0,61}[a-z0-9])?\.)+[a-z0-9][a-z0-9-]{0,61}[a-z0-9]$/i;
    // [a-zA-Z0-9][a-zA-Z0-9-]{1,61}[a-zA-Z0-9]\.[a-zA-Z]{2,}
    return regex.test(value);
};
/**
 * Parse các valiation rule, cho vào thuộc tính validation.
 * @param {DOMNode} el Đối tượng DOM
 */
CV.parseValidation = (el) => {
    let rules = {};

    // Người dùng truyền bằng thuộc tính data-validation
    if (el.dataset.validation) {
        rules = CV.parseValidationFromString(el.dataset.validation);
    }

    // Biểu thức chính quy có thể phức tạp nên để riêng
    if (el.dataset.validationRegex) {
        //console.log(el.dataset.validationRegex, el.dataset.validationRegexMessage);
        rules.regexPattern = el.dataset.validationRegex;
        rules.regexPatternMessage = el.dataset.validationRegexMessage;
    }

    el.validation = rules;
};

/**
 * Parse các valiation rule từ xâu.
 * @param {String} validationRules Xâu các luật validate, cách nhau bởi dấu |
 */
CV.parseValidationFromString = (validationRules) => {
    const rules = {};

    validationRules.split('|').forEach(rule => {
        const a = rule.split(':');
        const s = a[0];
        if (s == 'required') {
            rules.required = true;
            rules.requiredMessage = (a.length > 1) ? a[1] : 'Vui lòng nhập trường này';
        } else if (s == 'groupRequired') {
            rules.groupRequired = true;
            rules.groupRequiredName = a[1];
            rules.groupRequiredMessage = (a.length > 2) ? a[2] : 'Vui lòng chọn ít nhất một tùy chọn';
        } else if (s == 'email') {
            rules.email = true;
            rules.emailMessage = (a.length > 1) ? a[1] : 'Email không hợp lệ';
        } else if (s == 'phone') {
            rules.phone = true;
            rules.phoneLengthMessage = 'Số điện thoại dài từ 9 đến 12 số. Bạn nhập vào {0} số';
            rules.phoneFormatMessage = 'Số điện thoại chỉ được bao gồm số';
        } else if (s == 'integer') {
            rules.integer = true;
            rules.integerMessage = (a.length > 1) ? a[1] : 'Số nguyên không hợp lệ';
        } else if (s == 'numeric') {
            rules.numeric = true;
            rules.numericMessage = (a.length > 1) ? a[1] : 'Số không hợp lệ';
        } else if (s == 'date') {
            rules.date = true;
            rules.dateMessage = (a.length > 1) ? a[1] : 'Ngày không hợp lệ';
        } else if (s == 'idNumber') {
            rules.idNumber = true;
            rules.idNumberLengthMessage = 'Chứng minh thư phải chứa 9 hoặc 12 ký tự. Bạn nhập vào {0} ký tự.';
            rules.idNumberOnlyLetterMessage = 'Chứng minh thư chỉ được chứa chữ và số';
            rules.idNumberHasNumberMessage = 'Chứng minh thư phải chứa số';
        } else if (s == 'domainName') {
            rules.domainName = true;
            rules.domainNameMessage = (a.length > 1) ? a[1] : 'Tên miền không hợp lệ';
        } else if (s == 'password') {
            rules.password = true;
            rules.passwordLengthMessage = 'Mật khẩu phải chứa ít nhất 8 ký tự. Bạn nhập vào {0} ký tự.';
            rules.passwordSpaceMessage = 'Mật khẩu không được chứa dấu cách';
            rules.passwordVietnameseMessage = 'Mật khẩu không được chứa ký tự tiếng Việt';
        } else if (s == 'passwordStrong') {
            rules.passwordStrong = true;
            rules.passwordStrongMessage = (a.length > 1) ? a[1] : 'Mật khẩu phải bao gồm chữ hoa, chữ thường, số, ký tự đặc biệt';
        } else if (s == 'regex') {
            rules.regexPattern = a[1];
            rules.regexPatternMessage = a[2];
        } else if (s == 'minLength') {
            rules.minLength = parseInt(a[1]);
            rules.minLengthMessage = (a.length > 2) ? a[2] : 'Vui lòng nhập ít nhất {0} ký tự';
        } else if (s == 'maxLength') {
            rules.maxLength = parseInt(a[1]);
            rules.maxLengthMessage = (a.length > 2) ? a[2] : 'Vui lòng nhập nhiều nhất {0} ký tự';
        } else if (s == 'min') {
            rules.min = parseFloat(a[1]);
            rules.minMessage = (a.length > 2) ? a[2] : 'Giá trị nhỏ nhất là {0}';
        } else if (s == 'max') {
            rules.max = parseFloat(a[1]);
            rules.maxMessage = (a.length > 2) ? a[2] : 'Giá trị lớn nhất là {0}';
        } else if (s == 'same') {
            rules.same = a[1];
            rules.sameMessage = a[2];
        } else if (s == 'maxFileSize') {
            rules.maxFileSize = parseFloat(a[1]);
            rules.maxFileSizeMessage = (a.length > 2) ? a[2] : 'Dung lượng file vượt quá {0} MB ({1} MB)';
        } else if (s == 'fileTypes') {
            rules.fileTypes = a[1];
            rules.fileTypesMessage = (a.length > 2) ? a[2] : 'Vui lòng chọn file: {0}';
        } else if (s == 'in') {
            console.log('in');
            rules.valueIn = a[1];
            rules.valueInMessage = (a.length > 2) ? a[2] : 'Vui lòng chọn: {0}';
        }
    });

    return rules;
};

/**
 * Reset lại các cấu hình validate, để sau này có thể được parse lại.
 * Hay dùng khi cần áp dụng các cấu hình mới.
 * @param {DOMNode} el Đối tượng DOM
 */
CV.resetValidation = (el) => {
    el.validation = null;
};
/**
 * Yêu cầu nhập.
 */
CV.checkRequired = (value, validation) => {
	if (!validation.required) {
		return '';
	}

	// Chú ý trường hợp nhập 0 nên không sử dụng "if (!value)"
	if (CV.validateEmpty(value)) {
		return CV.tranlateErrorMessage(validation.requiredMessage);
	}
};

/**
 * Yêu cầu chọn ít nhất một tùy chọn.
 */
CV.checkGroupRequired = (validation) => {
	if (!validation.groupRequired) {
		return '';
    }
    
    let hasValueNumber = 0;
    let arr = document.querySelectorAll('[name="' + validation.groupRequiredName + '"]');
    
    arr.forEach(obj => {
        CV.clearSingleErrorMessage(obj);
        if (['checkbox', 'radio'].includes(obj.type)) {
            if (obj.checked) {
                hasValueNumber++;
            }
        } else {
            if (!CV.validateEmpty(obj.value)) {
                hasValueNumber++;
            }
        }
    });

	if (hasValueNumber == 0) {
		return CV.tranlateErrorMessage(validation.groupRequiredMessage);
	}
};

/**
 * Chiều dài dữ liệu.
 */
CV.checkLength = (value, validation) => {
	let min = validation.minLength;
	if (min != undefined) {
		if (value.length < min) {
			return CV.tranlateErrorMessage(validation.minLengthMessage).format(min);
		}
	}

	let max = validation.maxLength;
	if (max != undefined) {
		if (value.length > parseInt(max)) {
			return CV.tranlateErrorMessage(validation.maxLengthMessage).format(max);
		}
	}

	return '';
};

/**
 * Kiểm tra kiểu dữ liệu (email, số điện thoại, số nguyên, số, tên miền, date, chứng minh thư,...).
 */
CV.checkType = (value, validation) => {
	// Nếu không nhập rồi thì không validate nữa
	if (CV.validateEmpty(value)) {
		return '';
	}

	if (validation.email) {
		if (!CV.validateEmail(value)) {
			return CV.tranlateErrorMessage(validation.emailMessage);
		}
	}

	if (validation.phone) {
        //value = normalizePhoneNumber(value);
        //el.value = value;

		if (!CV.validatePhoneLength(value)) {
			return validation.phoneLengthMessage.format(value.length);
		}

		if (!CV.validatePhoneFormat(value)) {
			return CV.tranlateErrorMessage(validation.phoneFormatMessage);
		}
	}

	if (validation.integer) {
		if (!CV.validateInteger(value)) {
			return CV.tranlateErrorMessage(validation.integerMessage);
		}
	}

	if (validation.numeric) {
		if (!CV.validateNumber(value)) {
			return CV.tranlateErrorMessage(validation.numericMessage);
		}
	}

    if (validation.date) {
        if (!CV.validateDate(value)) {
            return CV.tranlateErrorMessage(validation.dateMessage);
        } else {
            //value = normalizeDate(value);
            //el.value = value;
        }
    }

    if (validation.idNumber) {
        if (!CV.validateIdNumberLength(value)) {
            return CV.tranlateErrorMessage(validation.idNumberLengthMessage).format(value.length);
        }

        if (!CV.validateIdNumberOnlyLetter(value)) {
            return CV.tranlateErrorMessage(validation.idNumberOnlyLetterMessage);
        }

        if (!CV.validateIdNumberHasNumber(value)) {
            // Không được chỉ có chữ không
            return CV.tranlateErrorMessage(validation.idNumberHasNumberMessage);
        }
    }

    // Không được bắt theo type='password' vì có thể bắt khi người dùng đăng nhập
    // Chỉ validate khi thêm mới người dùng, hoặc đổi mật khẩu mới
    if (validation.password) {
        let a = [];
        if (!CV.validatePasswordLength(value)) {
            a.push(CV.tranlateErrorMessage(validation.passwordLengthMessage).format(value.length));
        }

        if (CV.validatePasswordSpace(value)) {
            a.push(CV.tranlateErrorMessage(validation.passwordSpaceMessage));
        }

        if (CV.validatePasswordVietnamese(value)) {
            a.push(CV.tranlateErrorMessage(validation.passwordVietnameseMessage));
        }

        if (a.length > 0) {
            return a;
        }
	}
	
	if (validation.passwordStrong) {
		if (!CV.validatePasswordStrong(value)) {
			return CV.tranlateErrorMessage(validation.passwordStrongMessage);
		}
	}

	if (validation.domainName) {
		// console.log('Vào đây', validation, value);
		if (!CV.validateDomainName(value)) {
			// console.log(validation.domainNameMessage);
			return CV.tranlateErrorMessage(validation.domainNameMessage);
		}
	}

	// Domain, IP, URL, time,...

	return '';
};

/**
 * Kiểm tra khoảng của số hoặc ngày tháng:
 * - Nhỏ nhất
 * - Lớn nhất
 * - Nhỏ hơn
 * - Lớn hơn
 * - Ngày trước khoảng thời gian
 * - Ngày sau khoảng thời gian
 */
CV.checkRange = (value, validation) => {
	if (CV.validateEmpty(value)) {
		return '';
	}

	let minValue = validation.min;
	if (minValue != undefined) {
		if (minValue > parseFloat(value)) {
			return CV.tranlateErrorMessage(validation.minMessage).format(minValue);
		}
	}

	let maxValue = validation.max;
	if (maxValue != undefined) {
		if (maxValue < parseFloat(value)) {
			return CV.tranlateErrorMessage(validation.maxMessage).format(maxValue);
		}
	}

	/*
	let lessThan = ;
	let greaterThan = ;
	let before = ;
	let after = ;
	*/

	return '';
};

/**
 * Kiểm tra theo biểu thức chính quy nào đó.
 */
CV.checkPattern = (value, validation) => {
	if (validation.regexPattern) {
		if (value && !new RegExp(validation.regexPattern).test(value)) {
			return CV.tranlateErrorMessage(validation.regexPatternMessage);
		}
	}

	return '';
};

/**
 * Don't use this, use 'Show password' instead.
 */
CV.checkMatch = (value, validation) => {
	let match = validation.same;
	if (match) {
		if (value != document.querySelector(match).value) {
			return CV.tranlateErrorMessage(validation.sameMessage);
		}
	}

	return '';
};

/**
 * Kiểm tra dung lượng file và đuôi file.
 */
CV.checkFileSizeAndType = (el) => {
	// Nếu không phải là file thì bỏ qua luôn
	if (el.type != 'file') {
		return '';
	}

	// Nếu chưa chọn file cũng bỏ qua luôn
	if (el.files.length == 0) {
		return '';
	}

	// File là phần tử thứ nhất
	let file = el.files[0];
	
	// Danh sách lỗi
	let msg = [];

	let maxFileSize = el.validation.maxFileSize;
	if (maxFileSize != undefined) {
		let filesize = file.size;
		filesize = parseFloat(filesize / 1024 / 1024).toFixed(2);
		if (filesize > maxFileSize) {
			msg.push(el.validation.maxFileSizeMessage.format(maxFileSize, filesize));
		}
	}

	let fileTypes = el.validation.fileTypes;
	if (fileTypes) {
		let filename = file.name;
		let regex = new RegExp('(.*?)\.(' + fileTypes.toLowerCase().replace(/,/g, '|') + ')$');
		if (!(regex.test(filename.toLowerCase()))) {
			msg.push(el.validation.fileTypesMessage.format(fileTypes.replace(/,/g, ', ')));
		}
	}

	return msg.join('\n');
};

/**
 * Kiểm tra giá trị ở trong tập các giá trị cho trước.
 * Không phân biệt chữ hoa, chữ thường.
 */
CV.checkValueIn = (value, validation) => {
	// Nếu không nhập rồi thì không validate nữa
	if (CV.validateEmpty(value)) {
		return '';
	}

	let inValues = validation.valueIn;
	if (inValues) {
		let arr = inValues.split(',');
		let obj = arr.find(s => s.trim().toLowerCase() == value.toLowerCase());
		if (!obj) {
			return validation.valueInMessage.format(inValues);
		}
	}

	return '';
};
/**
 * Xóa các thông báo lỗi.
 * @param form Form CSS selector (có thể nhập hoặc không), hoặc một phần tử DOM.
 */
CV.clearErrorMessages = (form) => {
    if (typeof form == 'string') {
        const prefix = form ? (form + ' ') : '';
        document.querySelectorAll(prefix + '.validate-container .has-error').forEach((el) => {
            CV.clearSingleErrorMessage(el);
        });
    } else {
        form.querySelectorAll('.validate-container .has-error').forEach((el) => {
            CV.clearSingleErrorMessage(el);
        });
    }	
};

/**
 * Xóa thông báo lỗi.
 * @param {DOMNode} el Đối tượng input
 */
CV.clearSingleErrorMessage = (el) => {
    el.classList.remove('has-error');
    const errors = el.closest('.validate-container').querySelectorAll('.error-message');
    if (errors) {
        errors.forEach(err => err.remove());
    }
};

/**
 * Hiển thị thông báo lỗi.
 * @param el Đối tượng DOM (input, textarea, select)
 * @param errorMessage Thông báo lỗi
 */
CV.showError = (el, errorMessage) => {
	// Tạo thẻ span thông báo lỗi
	const message = document.createElement('span');
	message.className = 'error-message';
	message.textContent = Array.isArray(errorMessage) ? errorMessage.join("\n") : errorMessage;

	// Cập nhật thẻ DOM
	el.classList.add('has-error');

	// Thêm thông báo lỗi
	const container = el.closest('.validate-container');
	container.appendChild(message);
};

/**
 * Validate trường đầu vào.
 * Lấy thông báo lỗi của 1 trường input.
 * Trả về khác NULL và khác rỗng nếu có lỗi.
 * @param el 
 */
CV.getValidateError = (el) => {
    // Nếu dev chủ định bỏ qua
    if (el.dataset.ignoreValidate) {
        return null;
    }

    // Không validate trường ẩn hoặc bị disabled
    if (el.style.display == 'none' || el.style.visibility == 'hidden' || el.disabled == true) {
        return null;
    }

    // Bỏ qua các trường ẩn (do parent ẩn)
    if (el.offsetWidth <= 0 || el.offsetHeight <= 0) {
        return null;
    }

    // Nếu chưa parse các luật validation thì parse
    if (!el.validation) {
        CV.parseValidation(el);
    }

    // Sau đó validate
    // Chỗ file hơi khác nên tách riêng
    const errorMessage =
            CV.validateByValueAndValidation(el.value, el.validation) ||
            CV.checkFileSizeAndType(el) ||
            '';
    return errorMessage;
};

/**
 * Hàm validate.
 * Hàm này có các đầu vào là value và validation để có thể sử dụng ở nhiều chỗ, độc lập.
 * @param {String} value Giá trị
 * @param {Object} validation Đối tượng chứa các luật validate
 * @return Hàm trả về thông báo lỗi khi có lỗi, hoặc xâu rỗng khi hợp lệ
 */
CV.validateByValueAndValidation = (value, validation) => {
    value = value.trim();

    let errorMessage =
            CV.checkRequired(value, validation) ||
            CV.checkGroupRequired(validation) ||
            '';
        
    if (!errorMessage) {
        errorMessage = 
                CV.checkLength(value, validation) ||
                CV.checkType(value, validation) ||
                CV.checkRange(value, validation) ||
                CV.checkPattern(value, validation) ||
                CV.checkMatch(value, validation) ||
                CV.checkValueIn(value, validation) ||
                '';
    }

    return errorMessage;
};

/**
 * Kiểm tra xem form có dữ liệu hợp lệ không.
 * @param form Form CSS Selector (bắt buộc), hoặc phần tử DOM
 * @return true nếu form KHÔNG hợp lệ
 */
CV.invalidForm = (form) => {
	// Xóa tất cả thông báo lỗi cũ
	CV.clearErrorMessages(form);

	// Có lỗi hay không
	let flag = false;

	// Lưu thông tin thẻ có lỗi đầu tiên
	let firstField = null;

    // Duyệt qua các thẻ nhập
    let elements;
    if (typeof form == 'string') {
        elements = document.querySelectorAll(
                form + ' .validate-container input, ' +
                form + ' .validate-container textarea, ' +
                form + ' .validate-container select');
    } else {
        elements = form.querySelectorAll(
                '.validate-container input, ' +
                '.validate-container textarea, ' +
                '.validate-container select');
    }

	elements.forEach((el) => {
        // Trim giá trị
        if (el.type != 'file') {
            const value = el.value;
            el.value = value.trim();
        }

        const errorMessage = CV.getValidateError(el);

		// Nếu có lỗi
		if (errorMessage && errorMessage.length > 0) {
            // console.log(errorMessage, errorMessage.length);
            CV.showError(el, errorMessage);
			flag = true;
			if (firstField == null) {
				firstField = el;
			}
		} else {
            // Chuẩn hóa định dạng ngày tháng
            if (el.validation && el.validation.date) {
                const value = el.value;
                if (CV.validateDate(value)) {
                    el.value = CV.normalizeDate(value);
                }
            }
        }
	});

	// Focus và scroll đến phần tử lỗi đầu tiên
	if (firstField != null) {
		firstField.focus();
	}

	return flag;
};

/**
 * Gắn thêm các event để validate khi người dùng nhập (input, blur).
 * @param formSelector Form CSS Selector
 */
CV.addRealTimeValidation = () => {
    document.addEventListener('input', (evt) => {
        const el = evt.target;
        if (el.matches(' .validate-container input, ' +
			        ' .validate-container textarea, ' +
			        ' .validate-container select')) {
            if (el.matches('.has-error')) {
                CV.clearSingleErrorMessage(el);
            }
            el.classList.remove('valid');

            const errorMessage = CV.getValidateError(el);

            if (errorMessage && errorMessage.length > 0) {
                // console.log(errorMessage, errorMessage.length);
                CV.showError(el, errorMessage);
            } else {
                el.classList.add('valid');
            }
        }
    });
};
// Khởi tạo
(() => {
    // Thêm hàm String format
    if (!String.prototype.format) {
        String.prototype.format = function () {
            const args = arguments;

            return this.replace(/{(\d+)}/g, (match, number) => {
                return (typeof args[number] != 'undefined') ? args[number] : match;
            });
        };
    }

    CV.addRealTimeValidation();
})();


(() => {
    /**
     * Lắng nghe sự kiện cho một phần tử.
     */
    if (!Element.prototype.on) {
        Element.prototype.on = function (type, callback, options) {
            this.addEventListener(type, callback, options);
            return this; // for chaining
        };
    }

    /**
     * Delegate event.
     */
    if (!Element.prototype.delegate) {
        Element.prototype.delegate = function (type, selector, callback) {
            this.addEventListener(type, (evt) => {
                let target = evt.target;
                let obj = target.closest(selector);
                if (obj) {
                    callback(evt, obj);
                }
            });
            return this;
        };
    }
})();

const CommonUtils = {};

/**
 * Trả về một phần tử.
 * @param {String} selector 
 */
CommonUtils.$ = (selector) => {
    return document.querySelector(selector);
};

/**
 * Trả về mảng luôn để có thể thực hiện các hàm như map, reduce,...
 * @param {String} selector 
 * @param {Element} rootNode 
 */
CommonUtils.$$ = (selector, rootNode = document) => {
    return [...rootNode.querySelectorAll(selector)];
};

/**
 * Bắt sự kiện.
 */
CommonUtils.delegateDocument = (type, selector, callback) => {
    document.addEventListener(type, (evt) => {
        const target = evt.target;
        const obj = target.closest(selector);
        if (obj) {
            callback(evt, obj);
        }
    });
};

/**
 * Tạo một phần tử.
 * @param {String} tag 
 * @param {Object} attributes 
 * @param {Array} children Danh sách phần tử con
 */
CommonUtils.createElement = (tag, attributes, children) => {
    const ele = document.createElement(tag);
    if (attributes) {
        for (let property in attributes) {
            if (attributes.hasOwnProperty(property)) {
                ele[property] = attributes[property];
            }
        }
    }
    if (children && children.length > 0) {
        children.forEach(child => {
            ele.appendChild(child);
        });
    }
    return ele;
};

/**
 * Tạo một phần tử.
 * @param {Object} obj Đối tượng, có các thuộc tính như "tag", "children",...
 */
CommonUtils.create = (obj) => {
    const tag = obj.tag;
    const children = obj.children;
    delete obj.tag;
    delete obj.children;
    return this.createElement(tag, obj, children);
};

/**
 * Lấy các tham số của form.
 * Các giá trị được encode.
 * @param {String} formId ID của form
 */
CommonUtils.getFormAsString = (formId) => {
    const formElement = document.getElementById(formId);
    return new URLSearchParams(new FormData(formElement)).toString();
};

/**
 * Chuyển đối tượng JS thành xâu tham số.
 */
CommonUtils.jsonToQueryString = (json) => {
    return '?' +
        Object.keys(json).map((key) => {
            return encodeURIComponent(key) +
                '=' +
                encodeURIComponent(json[key]);
        }).join('&');
};


/**
 * Escape các ký tự đặc biệt thành mã HTML entity tương ứng.
 * Fix bug XSS.
 * @param {String} s Xâu cần escape
 */
CommonUtils.escapeHtml = (s) => {
    if (typeof s === 'string') {
        return s.replace(/</g, '&lt;')
                .replace(/>/g, '&gt;')
                .replace(/"/g, '&quot;');
    }
    return s;
};

/**
 * Phân cách dấu phảy phần ngàn.
 */
CommonUtils.formatThousands = (num) => {
    return num.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, '$1,')
};


CommonUtils.prettifyNumber = (num, digits) => {
    if (digits == undefined) {
        digits = 1;
    }

    const si = [
        { value: 1E18, symbol: 'E' },
        { value: 1E15, symbol: 'P' },
        { value: 1E12, symbol: 'T' },
        { value: 1E9, symbol: 'G' },
        { value: 1E6, symbol: 'M' },
        { value: 1E3, symbol: 'k' }
    ];
    for (let i = 0; i < si.length; i++) {
        if (num >= si[i].value) {
            const n = (num / si[i].value).toFixed(digits);

            // Xóa những chữ số 0 đằng sau dấu thập phân
            // Nếu chỉ để 0+ thì sẽ không xóa được dấu .
            // Nếu chỉ để \.0+ thì sẽ không xử lý được trường hợp 123.400
            return n.replace(/\.?0+$/, '') + si[i].symbol;
        }
    }
    return num.toFixed(digits);
};


/**
 * Tính toán số ngày giữa hai ngày (toDate - fromDate).
 * @param {Date} fromDate Từ ngày
 * @param {Date} toDate Đến ngày
 * @return {Integer} Số ngày giữa 2 ngày (ví dụ từ ngày 1/1 đến 10/1 có 9 ngày)
 */
CommonUtils.dateDiff = (fromDate, toDate) => {
    const oneDay = 24 * 60 * 60 * 1000;
    return Math.round((toDate.getTime() - fromDate.getTime()) / oneDay);
};

/**
 * Thêm bao nhiêu ngày vào một ngày có sẵn.
 * @param {Date} fromDate Ngày bắt đầu
 * @param {Integer} numberOfDate Số ngày thêm vào
 */
CommonUtils.addDate = (fromDate, numberOfDate) => {
    const oneDay = 24 * 60 * 60 * 1000;
    return new Date(fromDate.getTime() + numberOfDate * oneDay);
};

/**
 * Trả về một đối tượng Date từ một xâu có định dạng (dd/MM/yyyy).
 * @param {String} dateString Xâu ngày tháng
 * @retun {Date} Một đối tượng Date
 */
CommonUtils.converStringToDate = (dateString) => {
    const a = dateString.split(/\/|-/);
    const date = a[0];
    const month = a[1];
    const year = a[2];
    return new Date(year + '-' + month + '-' + date);
};

/**
 * Trả về đối tượng Date từ xâu dạng YYYY-MM-DDTHH:MM:SSZ
 * @param {String} isoString Xâu ngày tháng, định dạng ISO 8601
 */
CommonUtils.convertStringWithTimeToDate = (isoString) => {
    return new Date(isoString);
};

/**
 * Chuyển đối tượng Date sang xâu dạng dd/MM/yyyy.
 * @param {Date} date Một đối tượng Date
 * @return {String} Một xâu dạng dd/MM/yyyy tương ứng
 */
CommonUtils.convertDateToString = (date) => {
    return CommonUtils.paddingTwoZero(date.getDate()) + '/' +
            CommonUtils.paddingTwoZero(date.getMonth() + 1) + '/' +
            date.getFullYear();
};



/**
 * Chuyển đối tượng Date sang xâu dạng "dd/MM/yyyy h24:mi:ss".
 * @param {Date} date Một đối tượng Date
 * @return {String} Một xâu dạng "dd/MM/yyyy h24:mi:ss" tương ứng
 */
CommonUtils.convertDateToStringWithTime = (date) => {
    return CommonUtils.convertDateToString(date) + ' ' +
            CommonUtils.paddingTwoZero(date.getHours()) + ':' +
            CommonUtils.paddingTwoZero(date.getMinutes()) + ':' +
            CommonUtils.paddingTwoZero(date.getSeconds());
};

/**
 * Thêm các chữ số 0 ở đầu để có độ dài là 2 ký tự.
 */
CommonUtils.paddingTwoZero = (n) => {
    return (n < 10) ? ('0' + n) : n;
};

/**
 * Chuẩn hóa ngày tháng về định dạng dd/MM/yyyy.
 * @param s Xâu định dạng ISO 8601
 */
CommonUtils.normalizeDate = (s) => {
    const d = CommonUtils.convertStringWithTimeToDate(s);
    return CommonUtils.convertDateToString(d);
};

/**
 * Download dữ liệu Blob.
 */
CommonUtils.downloadBlob = (blob, fileName) => {
    const link = window.URL.createObjectURL(blob);

    // Tạo một thẻ a tạm và giả lập thao tác click vào thẻ đó
    const a = document.createElement('a');
    a.download = fileName;
    a.innerHTML = 'Download file';
    a.href = link;
    a.style.display = 'none';
    a.onclick = (evt) => {
        // Remove the a tag
        document.body.removeChild(evt.target);
    };

    // Gắn nó vào DOM và thực hiện thao tác click
    document.body.appendChild(a);
    a.click();
};


/**
 * Lấy tham số từ URL.
 */
CommonUtils.getUrlParameter = (param) => {
    const urlParams = new URLSearchParams(window.location.search);
    return urlParams.get(param);
};


/**
 * Không thực hiện hàm luôn khi người dùng đang thao tác,
 * mà chờ sau khi người dùng đã thực hiện xong một khoảng thời gian nào đó.
 * @param {Function} func Hàm nghiệp vụ
 * @param {Integer} delay Millisecond
 */
CommonUtils.debounce = (func, delay) => {
    let inDebounce;

    return function () {
        const context = this;
        const args = arguments;

        clearTimeout(inDebounce);
        inDebounce = setTimeout(() => {
            func.apply(context, args);
        }, delay);
    };
};


/**
 * Giới hạn số lần gọi hàm.
 * Sau khi gọi hàm thành công thì cần chờ một khoảng thời gian để gọi tiếp.
 * @param {Function} func Hàm nghiệp vụ
 * @param {Integer} limit Millisecond
 */
CommonUtils.throttle = (func, limit) => {
    let inThrottle;

    return function () {
        const args = arguments;
        const context = this;

        if (!inThrottle) {
            func.apply(context, args);
            inThrottle = true;
            setTimeout(() => {
                inThrottle = false;
            }, limit);
        }
    };
};
/**
 * Pagi: A pagination library
 * Code mới nhất ở https://lockex1987.github.io/posts/lib - pagi/js/pagi.js.
 * 
 * @version 2.0.0
 * @author lockex1987
 */
class Pagi {

    /**
     * Khởi tạo.
     * @param {Object} options Tùy chọn
     */
    constructor(options = {}) {
        const defaultOptions = {
            showFirst: false,
            showLast: false,
            showPrevious: true,
            showNext: true,
            showNumbers: true,
            firstText: '<<', // 
            previousText: '&laquo;', // &lt;
            nextText: '&raquo;', // &gt;
            lastText: '>>', // 
            showNoRecordText: true,
            noRecordText: 'Không có bản ghi nào',
            showTotalNumber: true,
            pageSize: 10
        };

        Object.assign(this, defaultOptions, options);

        // Người dùng có thể truyền vào "container" hoặc "containerId"
        if (options.containerId) {
            this.container = document.getElementById(options.containerId);
        } else {
            this.container = options.container;
        }

        this.addClickListener(options.callbackFunc);
    }

    /**
     * Cập nhật.
     * @param {Integer} totalNumber Tổng số trang
     * @param {Integer} currentPage Trang hiện tại
     */
    update(totalNumber, currentPage) {
        this.setting(totalNumber, currentPage)
            .render();
    }

    /**
     * Thiết lập lại thông tin, tính toán lại.
     * Server cần trả về số bản ghi và trang hiện tại là trang nào.
     */
    setting(totalNumber, currentPage) {
        this.totalNumber = totalNumber;
        this.totalPage = Math.ceil(this.totalNumber / this.pageSize);
        this.currentPage = (currentPage > this.totalPage) ? this.totalPage : currentPage; // 1, 2

        // The logic in pagination is as follows:
        // - there are 5 page links shown at any time (e.g. 1 2 3 4 5) unless there are less than 5 total pages
        // - the active link (current page) is in the 3rd position, except for when the active link is below 3 or less than 2 from the last position
        this.startPage;
        this.endPage;
        if (this.totalPage <= 5) {
            this.startPage = 1;
            this.endPage = this.totalPage;
        } else if (this.currentPage <= 3) {
            this.startPage = 1;
            this.endPage = 5;
        } else if (this.currentPage + 2 >= this.totalPage) {
            this.startPage = this.totalPage - 4;
            this.endPage = this.totalPage;
        } else {
            this.startPage = this.currentPage - 2;
            this.endPage = this.currentPage + 2;
        }

        // Index bắt đầu, tiện khi hiển thị số thứ tự phân trang
        this.startIndex = (this.currentPage - 1) * this.pageSize;

        // Create an array of pages to ng-repeat in the pager control
        this.pages = [];
        for (let i = this.startPage; i <= this.endPage; i++) {
            this.pages.push(i);
        }

        return this;
    }

    /**
     * Click vào phân trang (thẻ A).
     * @param {Function} callbackFunc Hàm gọi
     */
    addClickListener(callbackFunc) {
        this.container.addEventListener('click', (evt) => {
            const target = evt.target;
            if (target.tagName == 'A') {
                if (!target.classList.contains('active') && !target.classList.contains('disabled')) {
                    const page = parseInt(target.dataset.page);
                    callbackFunc(page);
                }
            }
        });
    }

    /**
     * Hiển thị.
     */
    render() {
        // Xóa dữ liệu cũ
        this.container.innerHTML = '';

        // Nếu rỗng
        if (this.totalNumber <= 0) {
            if (this.showNoRecordText) {
                this.container.appendChild(this.createNoRecordText());
            }
        } else {
            if (this.showTotalNumber) {
                this.container.appendChild(this.createTotalNumberText());
            }

            if (this.totalPage > 1) {
                this.ulTag = this.createUlTag();

                this.createFirstPage();
                this.createPreviousPage();

                if (this.showNumbers) {
                    for (let i = this.startPage; i <= this.endPage; i++) {
                        this.createMiddlePage(i);
                    }
                }
                this.createNextPage();
                this.createLastPage();

                this.container.appendChild(this.ulTag);
            }
        }
    }

    /**
     * Thông báo không tồn tại dữ liệu.
     */
    createNoRecordText() {
        const elem = document.createElement('span');
        elem.className = 'no-record text-danger';
        elem.textContent = this.noRecordText;
        return elem;
    }

    /**
     * Thẻ UL bao.
     */
    createUlTag() {
        const ulTag = document.createElement('ul');
        ulTag.className = 'pagination mb-0';
        return ulTag;
    }

    /**
     * Link đến trang đầu tiên.
     */
    createFirstPage() {
        if (this.showFirst) {
            this.ulTag.appendChild(this.createItem(this.firstText, 1, (this.currentPage > 1 ? '' : 'disabled')));
        }
    }

    /**
     * Link đến trang trước.
     */
    createPreviousPage() {
        if (this.showPrevious) {
            this.ulTag.appendChild(this.createItem(this.previousText,
                (this.currentPage > 1 ? this.currentPage - 1 : 1),
                (this.currentPage > 1 ? '' : 'disabled')));
        }
    }

    /**
     * Link đến các trang ở tầm giữa.
     * @param {Integer} i Chỉ số trang
     */
    createMiddlePage(i) {
        this.ulTag.appendChild(this.createItem(i, i, (i === this.currentPage ? 'active' : '')));
    }

    /**
     * Link đến trang tiếp theo.
     */
    createNextPage() {
        if (this.showNext) {
            this.ulTag.appendChild(this.createItem(this.nextText,
                (this.currentPage < this.totalPage ? this.currentPage + 1 : this.totalPage),
                (this.currentPage < this.totalPage ? '' : 'disabled')));
        }
    }

    /**
     * Link đến trang cuối cùng.
     */
    createLastPage() {
        if (this.showLast) {
            this.ulTag.appendChild(this.createItem(this.lastText, this.totalPage, (this.currentPage < this.totalPage ? '' : 'disabled')));
        }
    }

    /**
     * Tạo các link.
     * @param {String} text Nhãn
     * @param {Integer} page Chỉ số trang
     * @param {String} className Style
     */
    createItem(text, page, className) {
        const liTag = document.createElement('li');
        liTag.className = 'page-item ' + className;

        if (className) {
            const spanTag = document.createElement('span');
            spanTag.className = 'page-link';
            spanTag.innerHTML = text;
            liTag.appendChild(spanTag);
        } else {
            const aTag = document.createElement('a');
            aTag.className = 'page-link';
            aTag.innerHTML = text;

            // SPA khi có thay đổi hash sẽ reload trang
            //aTag.href = '#' + page;
            aTag.href = 'javascript:;';

            aTag.dataset.page = page;
            liTag.appendChild(aTag);
        }
        return liTag;
    }

    /**
     * Hiển thị tổng số bản ghi.
     */
    createTotalNumberText() {
        const div = document.createElement('div');
        div.className = 'pagination-info text-muted small mr-2 mb-sm-2';
        div.textContent = 'Tổng số ' +
                (CommonUtils && CommonUtils.formatThousands ?
                    CommonUtils.formatThousands(this.totalNumber) :
                    this.totalNumber
                ) + ' bản ghi';
        return div;
    }
}
class Datatable {

    /**
     * Khởi tạo đối tượng.
     * @param {Object} options Các tùy chọn
     */
    constructor(options = {}) {
        // Khởi tạo các thuộc tính
        let defaultOptions = {};
        Object.assign(this, defaultOptions, options);

        // Người dùng có thể truyền vào xâu CSS selector của bảng hoặc trực tiếp DOM node của bảng
        // Nếu người dùng truyền vào xâu thì lấy ra DOM node
        if (typeof this.table == 'string') {
            this.table = document.querySelector(this.table);
        }

        // Thêm class đánh dấu cho bảng
        this.table.classList.add('datatable');

        this.createWrapper();

        this.checkBodyExist();

        // Người dùng truyền vào data hoặc là ajax
        if (this.data != undefined) {
            this.initLocal();
        } else if (this.ajax) {
            this.initRemote();
        }

        // Vùng phân trang
        let pagiContainer = this.createPagiContainer();

        this.pagi = new Pagi({
            container: pagiContainer,
            callbackFunc: this.gotoPage,
            pageSize: this.paginationSize || 10
        });

        // Lấy luôn dữ liệu
        this.gotoPage(1);

        // Xử lý các sự kiện:
        // - Click vào mũi tên expand
        // - Chọn dòng
        
        this.handleClickExpandableArrow();
        this.handleClickSelectableRow();

        // Hiển thị danh sách cột để ẩn hiện
        this.bindColumnList();
    }

    /**
     * Thêm vùng div .datatable-wrapper bao lấy thẻ table.
     */
    createWrapper() {
        if (this.table.parentNode.classList.contains('datatable-wrapper')) {
            return;
        }

        let wrapper = document.createElement('div');
        wrapper.className = 'datatable-wrapper';
        this.table.parentNode.insertBefore(wrapper, this.table);
        wrapper.appendChild(this.table);
    }

    /**
     * Kiểm tra thẻ tbody có hay không.
     * Nếu không có thì tự thêm.
     */
    checkBodyExist() {
        let tbody = this.table.querySelector('tbody');
        if (!tbody) {
            tbody = document.createElement('tbody');
            this.table.appendChild(tbody);
        }
    }

    /**
     * Tạo icon đang xử lý.
     */
    createLoader() {
        let loader = document.createElement('div');
        loader.className = 'loader';
        loader.innerHTML = `<svg version="1.1" id="loader-1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px"
                                    width="40px" height="40px" viewBox="0 0 40 40" enable-background="new 0 0 40 40" xml:space="preserve">
                                <path opacity="0.2" fill="#000" d="M20.201,5.169c-8.254,0-14.946,6.692-14.946,14.946c0,8.255,6.692,14.946,14.946,14.946
                                        s14.946-6.691,14.946-14.946C35.146,11.861,28.455,5.169,20.201,5.169z M20.201,31.749c-6.425,0-11.634-5.208-11.634-11.634
                                        c0-6.425,5.209-11.634,11.634-11.634c6.425,0,11.633,5.209,11.633,11.634C31.834,26.541,26.626,31.749,20.201,31.749z"/>
                                    <path fill="#000" d="M26.013,10.047l1.654-2.866c-2.198-1.272-4.743-2.012-7.466-2.012h0v3.312h0
                                            C22.32,8.481,24.301,9.057,26.013,10.047z">
                                            <animateTransform attributeType="xml"
                                            attributeName="transform"
                                            type="rotate"
                                            from="0 20 20"
                                            to="360 20 20"
                                            dur="0.5s"
                                            repeatCount="indefinite"/>
                                </path>
                            </svg>`;
        loader.style.display = 'none';
        this.table.parentNode.appendChild(loader);

        // Truyền vào tham số để ở phương thức initRemote() có thể sử dụng
        this.loader = loader;
    }

    /**
     * Khởi tạo trong trường hợp không dùng AJAX.
     */
    initLocal() {
        this.gotoPage = (page) => {
            if (this.startSearchCallback) {
                this.startSearchCallback();
            }

            var obj = this.getDataLocal(page);
            this.pagi.update(obj.total, page);
            this.bindItems(obj.data);
        };

        this.makeSortable(
            this.table,
            (column, direction) => {
                this.sortDataLocal(column, direction);

                this.gotoPage(1);
            }
        );

        // Xử lý ô search nhanh
        if (this.searchableProps && !this.hideQuickSearch) {
            this.searchInput = this.createSearchInput();

            this.searchInput.addEventListener('input', () => {
                this.filterDataLocal(this.searchInput.value.trim());
                this.gotoPage(1);
            });
        }

        this.filterDataLocal();
    }
    
    /**
     * Khởi tạo trong trường hợp sử dụng AJAX.
     */
    initRemote() {
        // Tạo icon đang xử lý
        if (this.showLoading) {
            this.createLoader();
        }

        this.gotoPage = (page) => {
            if (this.loader) {
                this.loader.style.display = '';
            }

            if (this.startSearchCallback) {
                this.startSearchCallback();
            }

            this.ajax(page, this.pagi.pageSize, this.sortColumn, this.sortDirection)
                .then(resp => {
                    if (this.loader) {
                        this.loader.style.display = 'none';
                    }

                    if (this.finishSearchCallback) {
                        this.finishSearchCallback(resp);
                    }

                    let total, data;
                    if (this.getTotalAndData) {
                        ({ total, data } = this.getTotalAndData(resp));
                    } else {
                        total = resp['total'];
                        data = resp['data'];
                    }

                    this.pagi.update(total, page);
                    this.bindItems(data);
                });
        };

        this.makeSortable(
            this.table,
            (column, direction) => {
                this.sortColumn = column;
                this.sortDirection = direction;

                this.gotoPage(1);
            }
        );

        this.sortColumn = '';
        this.sortDirection = '';
    }

    /**
     * Thêm vùng phân trang.
     */
    createPagiContainer() {
        const pagiContainer = document.createElement('div');
        pagiContainer.className = 'pagination-wrapper d-lg-flex align-items-center justify-content-between';

        // Người dùng thêm có thể thêm tùy chọn "paginationPosition" với giá trị "bellow" hoặc "above"
        const wrapper = this.table.parentNode;
        if (this.paginationPosition == 'bellow') {
            wrapper.parentNode.insertBefore(pagiContainer, wrapper.nextSibling);
        } else if (this.paginationPosition == 'above') {
            pagiContainer.classList.add('mb-3');
            wrapper.parentNode.insertBefore(pagiContainer, wrapper);
        } else {
            // Kiểm tra xem tùy chỉnh ở chỗ nào không
			const slot = wrapper.querySelector('.pagination-slot');
			if (slot) {
				slot.parentNode.replaceChild(pagiContainer, slot);
			} else {
				// Mặc định là ở dưới
				wrapper.parentNode.insertBefore(pagiContainer, wrapper.nextSibling);
			}
        }
        return pagiContainer;
    }

    /**
     * Hiển thị dữ liệu.
     * @param {Array} items Các bản ghi để hiển thị ở trang hiện tại
     */
    bindItems(items) {
        // Lưu biến trung gian để sử dụng ở phương thức getSelectedRows()
        this.items = items;

        // Thêm thuộc tính số thứ tự (stt) với mỗi phần tử để hiển thị cột số thứ tự cho dễ
        items.forEach((e, idx) => {
            e.stt = this.pagi.startIndex + idx + 1;
        });

        // Hiển thị dữ liệu với hàm rowTemplate của người dùng truyền vào
        if (this.rowTemplate) {
            if (items.length == 0) {
                this.table.style.display = 'none';
            } else {
                var html = '';
                items.forEach((e, idx) => {
                    html += this.rowTemplate(e);
                });
                this.table.querySelector('tbody').innerHTML = html;

                this.table.style.display = '';

                this.hideShouldBeHiddenColumns();
            }
        }

        // Gọi hàm callback
        // Vue có thể lấy dữ liệu ở đây
        if (this.bindItemsCallback) {
            this.bindItemsCallback(items);
        }
    }
    
    /**
     * Thêm ô search.
     */
    createSearchInput() {
        let searchWrapper = document.createElement('div');
        searchWrapper.className = 'py-2 d-flex justify-content-end';
        let searchInput = document.createElement('input');
        searchInput.className = 'form-control';
        searchInput.style.width = '200px';
        searchInput.placeholder = 'Tìm kiếm nhanh';
        searchWrapper.appendChild(searchInput);

        let wrapper = this.table.parentNode;
        wrapper.parentNode.insertBefore(searchWrapper, wrapper);

        return searchInput;
    }

    /**
     * Sắp xếp dữ liệu trên client (local).
     * @param {String} column Cột sắp xếp
     * @param {String} direction 'asc' hoặc 'desc'
     */
    sortDataLocal(column, direction) {
        this.data.sort((a, b) => {
            if (a[column] < b[column]) {
                return (direction == 'asc') ? -1 : 1;
            }
            if (a[column] > b[column]) {
                return (direction == 'asc') ? 1 : -1;
            }
            return 0;
        });
    }

    /**
     * Tìm kiếm nhanh trong trường hợp không sử dụng AJAX.
     */
    filterDataLocal(searchText) {
        if (!this.searchableProps) {
            this.filteredData = this.data;
        } else if (!searchText) {
            this.filteredData = this.data;
        } else {
            searchText = searchText.toLowerCase();
            this.filteredData = this.data.filter(e => {
                let foundProp = this.searchableProps.find(prop => e[prop].toLowerCase().includes(searchText));
                return !!foundProp;
            });
        }
    }

    /**
     * Thiết lập lại dữ liệu.
     * @param {Array} data Mảng dữ liệu
     */
    setData(data) {
        this.data = data;
    }

    /**
     * Lấy dữ liệu của một trang nào đó trong trường hợp không sử dụng AJAX.
     * @param {Integer} page Số thứ tự trang (bắt đầu từ 1)
     */
    getDataLocal(page) {
        let startIndex = (page - 1) * this.pagi.pageSize;
        let total = this.filteredData.length;
        let items = [];
        let end = Math.min(startIndex + this.pagi.pageSize, total);
        for (let i = startIndex; i < end; i++) {
            items.push(this.filteredData[i]);
        }
        return {
            total: total,
            data: items
        };
    }

    /**
     * Cho phép một bảng có thể sắp xếp được.
     * @param {DOMNode} table DOM node của bảng
     * @param {Function} callback Hàm callback
     */
    makeSortable(table, callback) {
        table.addEventListener('click', (evt) => {
            var attribute = 'data-sort-column';
            var target = evt.target;
            if (target.tagName == 'TH' && target.getAttribute(attribute)) {
                let iconSortAsc = 'sorting_asc';
                let iconSortDesc = 'sorting_desc';
    
                // Thẻ th hiện tại
                let thTag = target;
    
                // Lấy ra trường thông tin order
                let column = thTag.getAttribute(attribute);
    
                // Trạng thái order mới
                let direction = thTag.classList.contains(iconSortAsc) ? 'desc' : 'asc';
    
                // Xóa tất cả các order cũ
                table.querySelectorAll('[' + attribute + ']').forEach(otherTag => {
                    otherTag.classList.remove(iconSortAsc);
                    otherTag.classList.remove(iconSortDesc);
                });
    
                // Điều chỉnh lại mũi tên hiển thị của cột hiện tại
                thTag.classList.add(direction == 'asc' ? iconSortAsc : iconSortDesc);
    
                // Gọi hàm callback
                callback(column, direction);
            }
        });
    }

    /**
     * Tìm kiếm lại.
     */
    reload() {
        this.gotoPage(1);
    }

    /**
     * Thêm sự kiện click vào mũi tên để expand dòng nào đó.
     */
    handleClickExpandableArrow() {
        if (this.table.classList.contains('table-expandable')) {
            this.table.addEventListener('click', (evt) => {
                let target = evt.target;
                if (target.classList.contains('table-expandable-arrow')) {
                    let arrow = target;
                    arrow.classList.toggle('expanded');

                    let mainRow = arrow.closest('tr');
                    let detailRow = mainRow.nextElementSibling;
                    if (detailRow.style.display === 'none') {
                        detailRow.style.display = '';
                    } else {
                        detailRow.style.display = 'none';
                    }
                }
            });
        }
    }

    /**
     * Thêm sự kiện click để chọn dòng.
     */
    handleClickSelectableRow() {
        if (this.table.classList.contains('table-selectable')) {
            this.table.addEventListener('click', (evt) => {
                let target = evt.target;
                let row = target.closest('.table-selectable tbody tr');
                if (row) {
                    row.classList.toggle('selected-row');
                }
            });
        }
    }

    /**
     * Lấy ra dữ liệu của các dòng được chọn.
     */
    getSelectedRows() {
        let selectedRows = [];
        let rows = this.table.querySelectorAll('tbody tr');
        for (let i = 0; i < rows.length; i++) {
            if (rows[i].classList.contains('selected-row')) {
                selectedRows.push(this.items[i]);
            }
        }
        return selectedRows;
    }

    /**
     * Hiển thị danh sách các cột để ẩn hiện.
     */
    bindColumnList() {
        if (this.columnListNamespace) {
            // Thêm vùng div
            let columList = document.createElement('div');
            columList.className = 'datatable-column-list';
            columList.innerHTML = '<span class="text-muted">Hiển thị các cột:</span>';
            this.table.querySelectorAll('thead th').forEach((th, idx) => {
                let labelTag = document.createElement('label');
                labelTag.innerHTML = `<input type="checkbox" checked data-index="${idx}"> ${th.textContent.trim()}`;
                if (localStorage.getItem(this.columnListNamespace + idx) == 'hide') {
                    labelTag.querySelector('input').checked = false;
                }
                columList.appendChild(labelTag);
            });

            var wrapper = this.table.parentNode;
            wrapper.parentNode.insertBefore(columList, wrapper.nextSibling);
        
            // Thêm sự kiện
            columList.addEventListener('change', (evt) => {
                let checkbox = evt.target;
                let index = checkbox.dataset.index;
                let rows = this.table.querySelectorAll('tr');
                if (checkbox.checked) {
                    localStorage.removeItem(this.columnListNamespace + index);
                    rows.forEach(r => {
                        r.cells[index].style.display = '';
                    });
                } else {
                    localStorage.setItem(this.columnListNamespace + index, 'hide');
                    rows.forEach(r => {
                        r.cells[index].style.display = 'none';
                    });
                }
            });
        }
    }

    /**
     * Sau khi hiển thị xong dữ liệu của cột thì cần gọi hàm này để ẩn các cột cần ẩn.
     */
    hideShouldBeHiddenColumns() {
        if (this.columnListNamespace) {
            let rows = this.table.querySelectorAll('tr');
            let numOfColumns = rows[0].cells.length;
            for (let index = 0; index < numOfColumns; index++) {
                if (localStorage.getItem(this.columnListNamespace + index) == 'hide') {
                    rows.forEach(r => {
                        r.cells[index].style.display = 'none';
                    });
                }
            }
        }
    }
}


